text:
 @jpqdcria2420  concordo que a prioridade é a Libertadores. Mas a maioria bota os reservas no Brasileiro, por isso fazem menos pontos. 
Ontem eu não vi o jogo, mas contra o meu Corinthians não faltou dedicação do time, muito pelo contrário, os caras se mataram em campo. O problema foi tático, de organização defensiva. Esse é o perigo pra eles. E ontem pelo placar não faltou vontade e raça também.  
Vamos ver contra o Boca qual Fluminense estará em campo. Vou torcer pra eles na final. Precisam corrigir a parte defensiva e não ficar tão exposto. O Boca se faz 1 x 0 vai colocar os 11 atrás e fazer cera, é bom o Fluminense não tomar esses gols contra ele de cara senão é difícil se recuperar depois.
